import React,{useState} from 'react';

const Action = () => {
    const obj = {
        name: 'John',
        age: 30,
        city: 'New York'
    }
    const [number,setnumber] = useState(obj);
    const increment = () => {

            setnumber(prevState => ({
                ...prevState,
                age: prevState.age + 2

            }));
        console.log(number.age);
    };
    return (
        <div>
            <span>{number.age}</span>
            <button onClick={increment}>Update</button>
        </div>
    );
};

export default Action;

